import React from 'react';
import Symbols from './Symbol';
import '../assets/css/App.css';

const Reel = (props) => {

    const imageReelRender = () => {
        let reel = props.reel.map((image, imageIndex)=>{
            return  <Symbols symbol={image} key={imageIndex} spin={-1} index={imageIndex}/>;
        })

        return <>reel</>
    }

    return(
        <>
        {imageReelRender()}
        </>
    )
}



export default Reel;
